export const developmentConfig = {
  api: {
    baseUrl: 'http://localhost:8080/api',
    timeout: 30000, // Longer timeout for development
    retryAttempts: 1,
    retryDelay: 500,
  },
  auth: {
    tokenExpiry: 7 * 24 * 60 * 60 * 1000, // 7 days for easier development
    refreshTokenExpiry: 30 * 24 * 60 * 60 * 1000, // 30 days
  },
  security: {
    passwordMinLength: 6, // More lenient for development
    passwordRequireUppercase: false,
    passwordRequireLowercase: false,
    passwordRequireNumbers: false,
    passwordRequireSpecialChars: false,
  },
  upload: {
    maxFileSize: 10 * 1024 * 1024, // 10MB
    allowedMimeTypes: ['image/jpeg', 'image/png', 'image/gif'],
  },
  cache: {
    maxAge: 0, // No caching in development
    staleWhileRevalidate: 0,
  },
  errorReporting: {
    enabled: false,
    sampleRate: 1, // Report all errors in development
  },
  performance: {
    imageLazyLoading: false,
    routeBasedCodeSplitting: false,
    enableServiceWorker: false,
  },
};
